Sex Is On The Menu! Hot Fresh Pizza!

Kayden Kross buys a pizza restaurant from Ryan Driller who has given up on his business. To celebrate the new venture, Kayden surprises boyfriend Seth Gamble with a passion filled sex session that leaves him lip. But the romance doesn't last as Seth ditches her once he realizes she's serious about the pizza place.


